import React from 'react';
import Logo from '../images/Logo.png'
import '../styles/NavBar.css';
import leftarrow from '../images/leftarrow.png'
class NavBar extends React.Component{

    render (){
        return (
<nav className='navbar navbar-light' id="Nav">
<a className='navbar-brand' href="/">
    <img src="" className="d-inline-block align-top" id="Logo__img1" alt="Logo" loading="lazy"/>
  </a>
  <a className='navbar-brand' href="/">
    <img src={Logo} className="d-inline-block align-top" id="Logo__img" alt="Logo" loading="lazy"/>
  </a>
  </nav>

        )
    }
}
export default NavBar;
